import React, {useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import RightMenu from "@material-ui/core/Drawer" 
import {
    AppBar,
    Toolbar,
    ListItem,
    IconButton,
    ListItemText,
    ListItemIcon,
    Avatar,
    Divider,
    List,
    Typography,
    Box
} from "@material-ui/core";
import {
    ArrowBack,
    AssignmentInd,
    Home,
    Apps,
    ContactMail
} from "@material-ui/icons";
import avatar from "../profile-pic.jpg"

const useStyles = makeStyles(theme => ({
    navSlideContainer: {
        width: 250,
        background: "#212121",
        height: "30rem"
    },
    avatar: {
        display: "block",
        margin: "05rem auto",
        width: theme.spacing(13),
        height: theme.spacing(13)
    },
    color: {
        color:  "#b2ebf2"
    }
}));

const barItems = [
    {
        listIcon: <Home />,
        listText: "Home"
    },
    {
        listIcon: <AssignmentInd />,
        listText: "Resume"
    },
    {
        listIcon: <Apps />,
        listText: "Portfolio"
    },
    {
        listIcon: <ContactMail />,
        listText: "Contact"
    }
]

function Navbar() {
    const [state, setState] = useState({
        left: false
    })

    const toggleBar = (slider, open) => () => {
        setState({...state, [slider]:open})
    }
    const classes = useStyles()
    const sideList = slider => (
            <Box className={classes.navSlideContainer} component="div">
                <Avatar className={classes.avatar} src={avatar} alt="Profile Picture" />
                <Divider />
                <List>
                    {barItems.map((lsItem, key)=>(
                    <ListItem button key={key}>
                            <ListItemIcon className={classes.color}>
                              {lsItem.listIcon}</ListItemIcon>
                        <ListItemText className={classes.color} primary={lsItem.listText} />
                        </ListItem>
                    ))}
                </List>
            </Box>
    )
    return (
        <>
            <Box component="div">
            </Box>
        <Box component="nav">
            <AppBar position="static" style={{background: "#212121"}}>
                <Toolbar>
                    <IconButton>
                    <ArrowBack style={{color: "white"}} />
                    </IconButton>
                    <Typography variant="h5">
                            Mario Castro's Portfolio
                </Typography>
                        <RightMenu open>
                        </RightMenu>
                </Toolbar>
            </AppBar>
        </Box>
        </>    
    )
}

export default Navbar
